  return (
    <section>BlogPage
      <div className='Row'>
        
        <div className='rightrow1'>rightrow1</div>
        <div className='rightrow2'>rightrow2</div>
        <div className='leftcolum1'>leftcolum1</div>
        <div className='leftcolum2'>leftcolum2</div>

      </div>

      
    </section>
    
  )
}

export default BlogPage
